INSERT INTO `blogs` VALUES (1,'Children\'s Day','<p>Every child is a gift of nature. Give them their today, give them their time to play, and make way for their future. FBP wishes you all a very Happy Children\'s Day. Keep the child within you alive always.&nbsp;</p>','2023-11-14','2023-11-16 17:42:13.923000','2023-12-22 14:01:41.495000','2023-11-16 17:42:18.273000',1,1,'children-s-day'),(2,'Happy Diwali','<p>May the light of this auspicious celebration sweep the worlds gloom and pollutants away. May millions of lamps illuminate our life with endless joy, prosperity, health and wealth forever. FBP wishes you all and your loved ones a very happy and blessed Diwali!...</p>','2023-11-12','2023-11-16 17:42:32.445000','2023-12-22 14:02:17.382000','2023-11-16 17:44:01.023000',1,1,NULL),(3,'Happy 8th Year Anniversary','<p>Please join us in wishing our super-talented Vice President Sir, Mr. Dedeep T S, a Happy 8th Year Work Anniversary with FBP.&nbsp;<br>Thank you, Dedeep Sir for all of your hard work and we are so grateful to have you on the team.</p>','2023-11-06','2023-11-16 17:55:39.005000','2023-12-22 14:02:04.287000','2023-11-16 17:56:15.328000',1,1,'happy-8th-year-anniversary'),(4,'Surendra - Happy Birthday','<p>FBP wishes you a very Happy Birthday to our very talented Mr. Surendra Kumar. May your birthday brings you many happy reasons to celebrate.<br>Stay Blessed Always!</p>','2023-11-12','2023-11-16 18:01:18.653000','2023-12-22 14:02:33.345000','2023-11-16 18:01:21.537000',1,1,'surendra-happy-birthday');
/*!40000 ALTER TABLE `blogs` ENABLE KEYS */;
