INSERT INTO `builders` VALUES (9,'Akshaya','<p><strong>Akshaya</strong> Homes was founded in the year 1995 and has earned the prestigious ISO 9001:2008 certification. This real estate development company is based in Chennai and is headed by the Chairman and Chief Executive Officer, T. Chitty Babu. The company is engaged in several residential, hospitality and commercial projects alike. The company has always sought to set its own quality benchmarks in a competitive industry with its wide range of project offerings. &nbsp;</p>','2023-11-21 07:53:26.514000','2023-12-22 14:03:47.235000','2023-11-21 07:53:30.843000',1,1,'akshaya'),(10,'Risland The Ace','<p>Risland Holdings is a Hong Kong-based multinational real estate conglomerate. It offers a wide range of services such as residential development, commercial real estate operation, property management, and infrastructure construction &amp; operation. Becoming an innovative driver of urban development and residential environment improvement, Risland has developed projects in many countries including the United States, UK, Australia, New &nbsp;Zealand, Thailand, India, and Indonesia, etc &nbsp; As a promising international real estate company, Risland Holdings is committed to boosting social development while providing a better and comfortable residential environment. It ensures this through its diversified offerings that are environment-friendly, innovative and smart. They help in the creation of a user-friendly comprehensive community facility and service.&nbsp;</p>','2023-12-02 08:58:35.332000','2023-12-22 14:05:28.432000','2023-12-02 08:58:45.511000',1,1,'risland-the-ace'),(11,'Steps Stone','<p>Step Stones Builder:</p><p>StepsStone Promoters is one of the leading flat builders in &nbsp;Chennai. Stepsstone builders offer 1BHK, 2BHK and 3BHK apartments and flats in Chennai. Stepsstone Promoters is into developing Independent Houses, Bungalows, Flats, Apartments, Villas, Plot Layouts, Engineered Layouts with uncompromising Quality.&nbsp;</p>','2023-12-02 11:35:01.258000','2023-12-22 14:14:12.636000','2023-12-02 11:35:03.771000',1,1,'steps-stone'),(12,'KG Foundation','<p>KG Builders has earned the reputation of being one of Chennai\'s most trusted realty companies. We established our roots in the city in 1980 and have absorbed its culture to create strong values and virtues. KG has built an enduring relationship with the people of Chennai, through more than 160 projects that are delighting more than 6000 homeowners and corporate clients. We at KG enrich homes with passion and expertise.&nbsp; &nbsp;<br>With over 8 million sq. ft. of development in the pipeline and another 10 million sq. ft. planned to be developed over the next 3-5 years across the residential, commercial and hospitality space in Chennai, we are here for good and feel great to be here. KG will soon expand its presence with a spectrum of realty projects across Hyderabad and Bengaluru.<br>We at KG have always believed that the key to growth lies in harmonious relationships. Our special bond with Chennai has carried us through a successful journey of 37 years. And many more to come.</p>','2023-12-02 18:18:15.470000','2023-12-22 14:05:08.743000','2023-12-02 18:26:55.068000',1,1,'kg-foundation'),(13,'Hiranandani','<p>House of Hiranandani is a pioneer in developing integrated communities that have become landmarks in India. We have transformed the real estate skyline of Mumbai, Bengaluru, Chennai, and Hyderabad with our signature-styled neighborhoods that offer a holistic living experience to residents. Pillared by over four decades of experience and a unique approach to designing and planning, we invest heavily in research and development to ensure that our developments surpass industry benchmarks and redefine engineering and &nbsp;design.&nbsp;</p><p>Today, the brand is synonymous with excellence and strives to create value for all stakeholders at every step of development.</p><p>Through the environmental-friendly concepts of New Urbanism, our focus has been on transforming suburban sprawls of land into well-planned urban communities. Symbolic to our construction, our developments encompass the ether of the residents lives entirely, owing to retail outlets, hospitality centers, and healthcare and educational institutions built by us within the realms of the House of Hiranandani community. Our aim has always been to integrate every family into a bigger, more inclusive community.</p>','2023-12-02 18:27:45.285000','2023-12-22 14:04:59.838000','2023-12-02 18:27:47.679000',1,1,'hiranandani'),(14,'Lifestyle','<p>Stepped up in 2010, Lifestyle housing scouted some fine neighborhoods in Chennai and has developed homes and communities here ever since. With over 7 projects completed.&nbsp;</p>','2023-12-08 09:07:56.507000','2023-12-22 14:05:16.617000','2023-12-08 09:09:16.634000',2,1,'lifestyle'),(15,'RWD Serenity','','2023-12-18 14:10:06.625000','2023-12-22 14:14:00.834000','2023-12-21 16:43:47.791000',1,1,'rwd-serenity');
