INSERT INTO `components_property_facts_features` VALUES (17,'Akshaya Tango Features','<ul><li>Entrance Lobby</li><li>Paved Compound</li><li>Video Door Security</li><li>Library</li><li>Banquet Hall</li><li>Visitor Parking</li><li>Conference Room</li><li>Kid\'s Pool</li><li>Day Care Center</li><li>Yoga/Meditation Area</li><li>Gated Community</li><li>Landscape Garden and Tree Planting</li><li>Multipurpose Room</li><li>Power Backup</li><li>Ladies &amp; Gents Health Club</li></ul>'),(18,'Risland The Ace Features:','<ul><li>Cctv</li><li>Access control&nbsp;</li><li>Children\'s Activity area</li><li>Sandpit</li><li>Hopscotch</li><li>Kids Gym</li><li>Jamming Room</li><li>Swimming Pool&nbsp;</li><li>Multi Purpose Court</li><li>Youga Room,</li><li>Party Hall&nbsp;</li></ul>'),(19,'Step Stones Anans Features','<p>Features:</p><p>Schools in Perungudi include Sangford Schools, Montfort School, Laxminarayan English School, Panchayat School, Dass School etc.</p><p>Some of the prominent hospitals in the locality are Corporation Dental Hospital, Shree Hospital, CM Hospital, Vee Care Eye Hospital and Savitri Hospital.</p><p>Perungudi is strategically located on the Old Road (OMR) and at 4.6 kilometres of driving distance lies Velachery and Thiruvanmiyur. Sholinganallur is 12 minutes away from Perungudi via the OMR. MTC buses are a popular mode of transportation here and connects the locality with Adyar, Saidapet, Tiruvanmiyur and commercial destinations like Tambaram and Saidapet. In addition to this, new Bus routes are planned for this suburb that will connect interior areas of Perungudi like Rajiv Nagar, Kamraj Nagar, Elim Nagar and Telephone Nagar.</p>'),(20,'Akshaya Tango Features','<ul><li>Entrance Lobby</li><li>Paved Compound</li><li>Video Door Security</li><li>Library</li><li>Banquet Hall</li><li>Visitor Parking</li><li>Conference Room</li><li>Kid\'s Pool</li><li>Day Care Center</li><li>Yoga/Meditation Area</li><li>Gated Community</li><li>Landscape Garden and Tree Planting</li